import React, { useEffect, useState } from "react";
import {
  get,
  child,
  getDatabase,
  query,
  ref,
  set,
  orderByChild,
  remove,
  equalTo,
  onValue,
  orderByKey,
} from "firebase/database";

export default function Testman() {
  const [rows, setRows] = useState();

  useEffect(() => {
    const usrRef = ref(getDatabase(), "users");
    onValue(usrRef, (snapshot) => {
      const usrData = snapshot.val();
      const rows = [];

      for (let id in usrData) {
        rows.push(usrData[id]);
      }
      console.log(usrData)
      
      setRows(rows);
    });
  }, []);

  return <div>
    {rows ? rows.map((row)=> <h1> {row.userName} </h1>) : <h1>Loading</h1>}
  </div>;
}
